import React from 'react'
import { ServiceContainer,ServiceWrapper,
    ServiceIcon,Servicecard,
    ServiceP,Serviceh1,
    Serviceh2 } from './ServiceElement'
// import icon1 from "../../images/svg-4.svg";
// import icon2 from "../../images/svg-5.svg";
// import icon3 from "../../images/svg-6.svg";

const Services = () => {
    return (
        <>
            <ServiceContainer>
                <Serviceh1>Our Services</Serviceh1>
                    <ServiceWrapper>
                        <Servicecard>
                            <ServiceIcon >Reduce expances</ServiceIcon>
                            <Serviceh2>we help you to increase 
                                revenue and reduce fees</Serviceh2>
                        </Servicecard>
                        <Servicecard>
                            <ServiceIcon >Virtual offices</ServiceIcon>
                            <Serviceh2>You can access it 
                                from anywhere in the world</Serviceh2>
                        </Servicecard>
                        <Servicecard>
                            <ServiceIcon >Premium benefits</ServiceIcon>
                            <Serviceh2>Unlock our special memnership that will 
                                give you 5% cash back</Serviceh2>
                        </Servicecard>
                    </ServiceWrapper>  
            </ServiceContainer>  
        </>
    )
}

export default Services
